import React from 'react'
import Typed from 'react-typed'

const Header = () => {
    return (
        <div className='header'>
            <div className='text-box'>
                <Typed
                    strings={['Hello There', 'Hello World']}
                    typedSpeed={20}
                    backSpeed={30}
                    loop
                />
            </div>
        </div>
    )
}

export default Header
